import { Component, OnInit } from '@angular/core';
import { DataServiceService } from '../data-service.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {

constructor(private service: DataServiceService,
            private route: Router){ }

  ngOnInit(): void {}

  orgName: string = '';
  contact: any;
  email: string = '';
  streetAddress: string = '';
  city: string = '';
  district: string = '';
  block: string = '';
  zipCode: string = '';
  state: string = '';

  onSubmit() {

    const data = {
      organisation : this.orgName,
      streetAddress: this.streetAddress,
      city: this.city,
      district: this.district,
      block: this.block,
      zipCode: this.zipCode,
      state: this.state,
      contact: this.contact
    }

     this.service.signUp(data).subscribe((response: any) => {
        console.log('Form submitted successfully', response);
        this.route
      }, (error: any) => {
        console.error('Error submitting form', error);
      });
  }




}
<div class="container mt-5 mb-5">
  <div class="card shadow-lg p-4">
    <h2 class="text-center mb-4">Organization Signup</h2>

    <!-- Organization Name -->
    <div class="mb-3">
      <label for="orgName" class="form-label">Organization Name</label>
      <input type="text" id="orgName" [(ngModel)]="orgName" class="form-control" placeholder="Enter organization name" name="orgName">
    </div>

    <!-- Contact and Email -->
    <div class="row">
      <div class="col-md-6 mb-3">
        <label for="contact" class="form-label">Contact</label>
        <input type="tel" id="contact" [(ngModel)]="contact" class="form-control" placeholder="Enter contact number" name="contact">
      </div>
      <div class="col-md-6 mb-3">
        <label for="email" class="form-label">Email</label>
        <input type="email" id="email" [(ngModel)]="email" class="form-control" placeholder="Enter email address" name="email">
      </div>
    </div>

    <!-- Street Address -->
    <div class="mb-3">
      <label for="streetAddress" class="form-label">Street Address</label>
      <input type="text" id="streetAddress" [(ngModel)]="streetAddress" class="form-control" placeholder="Enter street address" name="streetAddress">
    </div>

    <!-- City and District -->
    <div class="row">
      <div class="col-md-6 mb-3">
        <label for="city" class="form-label">City</label>
        <input type="text" id="city" [(ngModel)]="city" class="form-control" placeholder="Enter city" name="city">
      </div>
      <div class="col-md-6 mb-3">
        <label for="district" class="form-label">District</label>
        <input type="text" id="district" [(ngModel)]="district" class="form-control" placeholder="Enter district" name="district">
      </div>
    </div>

    <!-- Block, Zip Code, and State -->
    <div class="row">
      <div class="col-md-4 mb-3">
        <label for="block" class="form-label">Block</label>
        <input type="text" id="block" [(ngModel)]="block" class="form-control" placeholder="Enter block" name="block">
      </div>
      <div class="col-md-4 mb-3">
        <label for="zipCode" class="form-label">Zip Code</label>
        <input type="text" id="zipCode" [(ngModel)]="zipCode" class="form-control" placeholder="Enter zip code" name="zipCode">
      </div>
      <div class="col-md-4 mb-3">
        <label for="state" class="form-label">State</label>
        <input type="text" id="state" [(ngModel)]="state" class="form-control" placeholder="Enter state" name="state">
      </div>
    </div>

    <!-- Submit Button -->
    <div class="text-center mt-4">
      <button type="submit" class="btn btn-primary btn-lg" (click)="onSubmit()">Sign Up</button>
    </div>
  </div>
</div>
